int main()
{

#ifdef REPORT
#ifdef SCTM
    unsigned int sctm_t1, sctm_t2, exec_diff;
    unsigned int overflow;
#endif
    FILE* fpReport = fopen("../../../report.csv","a+");
#endif
    int  fail=0;
    char loThresh = 2;
    char hiThresh = 10;

    /*---------------------------------------------------------------------*/
    /*  Function call to the VCOP-C API to be tested                       */
    /*---------------------------------------------------------------------*/

#if VCOP_HOST_EMULATION
#else
    unsigned int t0, t1;
    _tsc_start();
#endif

#if VCOP_HOST_EMULATION
#else
    t0 = _tsc_gettime();
#endif


#ifdef REPORT
#ifdef SCTM
    EVE_SCTM_Enable(CTM);
    EVE_SCTM_CounterConfig(CTM, SCTM_Counter_0, VCOP_BUSY, SCTM_DURATION);
    EVE_SCTM_CounterTimerEnable(CTM, SCTM_Counter_0);
    sctm_t1 = EVE_SCTM_CounterRead (CTM, SCTM_Counter_0);
#endif
#endif


    vcop_doublethresholding(pInMag, edgeMap, width, pitch, height, loThresh, hiThresh, edgeMap_out);

#ifdef REPORT
#ifdef SCTM
    sctm_t2 = EVE_SCTM_CounterRead (CTM, SCTM_Counter_0);
    overflow= EVE_SCTM_OverflowCheck(CTM,SCTM_Counter_0);
    assert(overflow!=1);
    EVE_SCTM_CounterTimerDisable(CTM, SCTM_Counter_0);
    exec_diff = sctm_t2 - sctm_t1;
#endif
#endif

#if VCOP_HOST_EMULATION
#else
    t1 = _tsc_gettime();
#endif

#ifdef REPORT
    fprintf(fpReport,"vcop_doublethresholding,");
    fprintf(fpReport,"%d,",width);
    fprintf(fpReport,"%d,",height);
    fprintf(fpReport,"%d,",width);
    fprintf(fpReport,"%d,",height);
    fprintf(fpReport,"1,");
#endif

    /*---------------------------------------------------------------------*/
    /*  Compare the results of output arrays with expected output arrays.  */
    /*---------------------------------------------------------------------*/
    fail = memcmp(edgeMap_out, edgeMap_gt, height*pitch);

    /*---------------------------------------------------------------------*/
    /*  If there is a mis-compare, print out a memory trace, else print    */
    /*  pass.                                                              */
    /*---------------------------------------------------------------------*/
    if (fail)
    {
#ifdef CONSOLE
        printf("FAIL\n");
#endif

#ifdef REPORT
        fprintf(fpReport,"FAIL,");
#endif
    }
    else{

#ifdef CONSOLE
        printf ("Pass \n");
#endif

#ifdef REPORT
        fprintf(fpReport,"PASS,");
#endif

#ifdef REPORT
#ifdef SCTM
        fprintf(fpReport,"%d\n",exec_diff);
#endif
#endif

#ifdef REPORT
        if(fpReport){
            fclose(fpReport);
        }
#endif
    }

#if VCOP_HOST_EMULATION
#else
    printf ("Time taken: %d cycles \n", (t1 - t0));
#endif

}

